ensighten-implementation/create-site-con.body:
4. Create Site Configuration Tag

Create a new Custom JavaScript called "Site Configuration" (Do not merge from other Configuration tag. If you do, it will inherit the settings and you will not be able to perform the next steps.).
Copy the Configuration code from the global template and add to the Site Configuration tag.
Update the configuration to appropriate values.
Choose Synchronous condition.
Choose the Configuration code from the global template to fire first.
Save changes.


Example Site Configuration Tag
